import React, { useState } from 'react';
import './App.css';

export default function App() {

    const [objectsArray, setObjectsArray] = useState([{ID: '', name: '', description: '', colorIdentifier: ''}]);

    const generateRandomObject = () => {
        setObjectsArray(objectsArray => {
            return [
                ...objectsArray,
                {ID: crypto.randomUUID(), name: '', description: '', colorIdentifier: ''}
            ]
        })
    }

    for (let i = 0; i <= 5; i++) {
        generateRandomObject();
    }

    console.log(objectsArray);

    return (
        <>
            {objectsArray}
        </>
    )
}
